import { lazy } from 'react';

import Emails from '../components/Emails';
import Main from '../pages/Main';

const routes = {
  main: {
    path: '/',
    element: Main,
  },
  emails: {
    path: '/emails',
    element: Emails,
  },
  invalid: {
    path: '/*',
    element: Emails,
  },
  view: {
    path: '/view',
    element: Emails,
  },
};

export { routes };
